import React, { Component } from 'react'
// CSS
import './App.css'
import Header from './components/Header'

class App extends Component {
  state = {
    pseudo: this.props.match.params.pseudo
  }

  render () {
    return (
      <div className='box'>
        <Header></Header>
        <div className='cards'>
          <div className='card'>
            <h2>Une Carte</h2>
          </div>
        </div>
      </div>
    )
  }
}

export default App
